import React, {Component} from 'react';
// import axios from 'axios';
import {
    withRouter
  } from 'react-router-dom'
class Historylist extends Component {
  constructor(props) {
    console.log('in History List!')
    super(props);
    console.log('this.props.locations,',this.props.locations)
    this.state = {
       locations:this.props.locations,
       top:this.props.locations.length,
       err:null
    }

  }

  top = e =>{
    var num = e.target.value;    
    this.setState({top:num}) 
  }

  date = e =>{
    var date = e.target.value;

  }
  render() {
    console.log("in history render!!!")
    console.log("top,",this.state.top)
    var section = null;

    section = this.state.locations && this.state.locations.map((next,i) => {
      return (
        <li key={i}>
          {i+1}. Ip Address: {next.ip} 
        </li>
        )
    })
    return(
        <div className='historylist'>
          <div className="filter">
            <form className="filtertop" onSubmit={this.submitTop}>
               <input type="number" id="top" onChange={this.top} placeholder="Search for top N..."></input>
               <p className='error'>{this.state.errtop}</p>
            </form>
            <form className="filtertop" onSubmit={this.submitTop}>
               <input type="date" id="date" onChange={this.date} placeholder="Search for date..."></input>
               <p className='error'>{this.state.errdate}</p>
            </form>

          </div>

          <ol>
          {section} 
          </ol>

        </div>


    )
  }
}

export default withRouter(Historylist);
